script: |
  super -f text -I q1827.spq | sort > q1827.out

inputs:
  - name: q1827.spq
    data: |
      SELECT DISTINCT - col1 FROM tab0 (FORMAT parquet) WHERE NOT + + ( + 64 ) BETWEEN + 51 + col2 + + CAST ( NULL AS INTEGER ) AND - + col0 * + col1 * + 95;
  - name: tab0

outputs:
  - name: q1827.out
    data: |
      -1
      -21
      -81
